import React from 'react';

import SiteNavbar from './SiteNavbar';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import LandingPhoto from '../img/landingPhoto.png';
import LandingDescriptionPhoto from '../img/landingDescriptionPhoto.png';

const Landing = () => {
	return (
		<div>
			<SiteNavbar />
			<div style={style.LandingDiv}></div>
			<Container fluid style={{ padding: '2vh 10%' }}>
				<Row>
					<Col xs={6}>
						<h3 style={style.Header3}>OUR MISSION</h3>
						<div style={style.TextContainer}>
							<p style={style.Text}>
								Create a <em>community of diverse individuals</em> that focuses
								on learning and skill development.
							</p>
							<p style={style.Text}>
								Research, design, manufacture, and test{' '}
								<strong>
									efficient, sustainable transportation technology
								</strong>{' '}
								at UC Berkeley.
							</p>
							<p style={style.Text}>
								Compete in the annual <em>Formula SAE Electric Competition</em>{' '}
								to demonstrate our technology at a global scale.
							</p>
						</div>
						<Button style={style.JoinButton}>JOIN THE TEAM</Button>
					</Col>
					<Col xs={6}>
						<img
							src={LandingDescriptionPhoto}
							alt="landing description"
							style={style.TextImage}
						/>
					</Col>
				</Row>
			</Container>
		</div>
	);
};

const style = {
	LandingDiv: {
		width: '100%',
		height: '60vh',
		backgroundImage: `url(${LandingPhoto})`,
		backgroundRepeat: 'no-repeat',
		backgroundAttachment: 'fixed',
		backgroundSize: '100% 100%',
	},
	Header3: {
		fontSize: '32px',
	},
	TextContainer: {
		padding: '6vh 0',
	},
	Text: {
		fontSize: '22px',
	},
	JoinButton: {
		width: '50%',
	},
	TextImage: {
		width: '80%',
	},
};

export default Landing;
